import React from "react";
import {
  FaHtml5,
  FaReact,
  FaJava,
  FaPython,
  FaNode,
  FaCss3,
  FaGit,
} from "react-icons/fa";
import { MdJavascript } from "react-icons/md";
import { BiLogoFlutter, BiLogoTailwindCss } from "react-icons/bi";
function Skills() {
  return (
    <div className="h-screen text-center">
      <h1 className="text-5xl">Skills</h1>
      <div className="grid gap-4 grid-cols-2 ">
        <FaHtml5 size={150} />
        <FaGit size={150} />
        <FaJava size={150} />
        <FaPython size={150} />
        <FaReact size={150} />
        <BiLogoTailwindCss size={150} />
        <FaNode size={150} />
        <FaCss3 size={150} />
        <BiLogoFlutter size={150} />
        <MdJavascript size={150} />
        <span className="text-4xl">C#</span>
        <span>SQL</span>
      </div>
    </div>
  );
}

export default Skills;
